import React from 'react';
import Projectitem from './projectitem';
import img from "../media/zifcareposter.png"

export default function Projects() {

  const projectdata ={title:1 , subtitle:<em>hi</em> , img:img}


  return (
    <div id='projects'>
      <h1 className="projects_header">My Projects</h1>
<div className="project_list">

  {projectdata.map((data)=>{ return  <Projectitem   title={data.title} subtitle={data.subtitle} img={data.img}   />})}
    
</div>

    </div>
  )
}
